import React from "react";
import styled from 'styled-components'
import SidebarItem from "./SidebarItem";
import SidebarItems from "./SidebarItems";

const SidebarParent = styled.div`
  background: #c34a36;
  width: 250px;
  height: 100vh;
`

function Sidebar() {
    return (
        <>
            <SidebarParent>
                {
                    SidebarItems.map(
                        (item)=>
                            <SidebarItem>
                                <p>{item.name}</p>
                            </SidebarItem>
                    )
                }
            </SidebarParent>
        </>
    );
}

export default Sidebar;
